import React, { Component } from "react";
class TableGrid extends Component {

    constructor(props) {
        super(props);
        this.getItemList =  this.getItemList(bind)
    }
  state = {};
  render() {
    return (
        <div className="col m-2 badge-secondary">
        {

          (this.props.itemList.map = (ele) => (
            <div className="row">
              <div className="col"></div>
              <div className="col"></div>
              <div className="col"></div>
              <div className="col"></div>
            </div>
          ))
        }
      </div>
    );
  }

  getItemList (data) {
    const payload = { message: data, sender: createUUID, metedata: { login: isUserLogged, authType: userAuthType } }
    fetch(url + 'webhook', {
      method: 'POST',
      body: JSON.stringify(payload),
      headers: {
        'Content-Type': 'application/json',
        'Content-type': 'application/x-www-form-urlencoded'
      }
    }).then(res => res.json())
      .then(response => {
        createDomSuggestion(response)
        smoothScroll()
      })
      .catch(error => console.error('Error:', error))
  }
}



export default TableGrid;
